/*Data for the table `mangga` */

insert  into `mangga`(`kode_mangga`,`nama_mangga`,`biner`,`foto`,`keterangan`) values (9,'Mangga Golek','010','golek.jpg','mangga golek termasuk salah satu jenis buah buahan yang terbaik. Berat<br/>\r\nrata rata 500-700 gram/buah, bentuk panjang, bulat agak pipih, pangkal buah <br/>\r\nagak lebar, dengan ujung runcing( segitiga tumpul ). Kulit berwarna hijau muda,<br/>\r\n kalau sudah masak berwarna kekuning kuningan berbintik bintik coklat dan putih.<br/>\r\n Rasanya manis dan halus tidak berserat.'),(10,'Mangga Manalagi','011','manalagi.jpg',NULL),(11,'Mangga Madu','100','madu.jpg',NULL),(12,'Mangga Curut','101','DSC_0097.jpg','mangga curut ( jawa ) adalah jenis buah mangga yang mempunyai rasa yang<br/>\r\nmasam, buahnya kecil dan berbau asam. Jenis mangga ini kebanyakan dihindari<br/>\r\noleh sebagian besar masyarakat karena buahnya yang kurang enak dikonsumsi<br/>\r\nlayaknya buah mangga jenis lainnya.'),(13,'Mangga Gadung','110','gadung.jpg','Ciri ciri mangga gadung adalah : <br/>\r\nBatang pohon tidak terlalu besar. Mempunyai cabang dan ranting banyak<br/>\r\nsehingga tampak rimbun. Ketika masih muda, warna kulit buahnya hijau muda.<br/>\r\nKetika sudah tua masak kulitnya berubah menjadi hijau kecoklatan.<br/>\r\nKulitnya dilapisi lilin tipis sehingga ketika sudah ranum kelihatan ungu<br/>\r\natau kebiru biruan. Buah ini rasanya manisdan berserat lembut. Buahnya <br/>\r\nberaroma harum, daging tebal dengan kulit tipis, rasanya manis dan berair.<br/>');

